content:
@WalkerBragman Pointing-out the long-running brutal policies of Saudi Arabia, Russia, China, or N. Korea isn't antisemitic.
Why is pointing-out Israel's similar brutal / genocidal policies antisemitic?
For example, Modi is practicing genocide on Muslims in India, just as Netenyahu is in Israel.

